import { useEffect, useState } from "react";
import "./App.css";

const Card = ({ title, src, des }) => {
  const [hasLiked, setHasLiked] = useState(false);
  const [count, setCount] = useState(0);

  useEffect(() => {
    console.log(`Card ${title} has been liked: ${hasLiked}`);
  },[hasLiked]);
  return (
    <div className="card" onClick={() => setCount(count + 1)}>
      <img width={200} height={200} src={src} alt="placeholder" />
      <h2>{title} {count}</h2>
      <p>{des}</p>
      <button className="btn" onClick={() => setHasLiked(!hasLiked)} >{hasLiked ? 'Liked' : 'Like'}</button>
    </div>
  );
};

function App() {
  return (


    <>
      <h1>React 19 by JavaScript Mastery</h1>
      <Card
        title={"Avatar"}
        des={
          "Jake, a paraplegic marine, replaces his brother on the Navi-inhabited Pandora for a corporate mission. He is accepted by the natives as one of their own, but he must decide where his loyalties lie."
        }
        src={
          "data:image/jpeg;base64,"
        }
      />
      <Card
        title={"Harry Potter"}
        des={
          "Harry Potter is a series of seven fantasy novels written by British author J. K. Rowling. The novels chronicle the lives of a young wizard, Harry Potter, and his friends, Hermione Granger and Ron Weasley, all of whom are students at Hogwarts School of Witchcraft and Wizardry."
        }
        src={
          "data:image/webp;base64,"
        }
      />
      <Card
        title={"Na Maloom Afraad"}
        des={
          "Farhan, Shakeel and Moon try to earn money by any means necessary. However, an illegal scheme of theirs goes horribly wrong and forces them to go on the run in the streets of Karachi."
        }
        src={
          "data:image/webp;base64,"
        }
      />
    </>
  );
}

export default App;
